import React, { Fragment } from "react";

import { Logo, Container, ContainerGift, Texto, Span } from "../styles/Home";

const Home = () => {
	return (
		<Fragment>
			<header>
				<Logo>
					<img className="logo-name" src="/images/GiftÜ.png" />
					<img className="logo-image" src="/images/logo.png" />
				</Logo>
			</header>
			<Container>
				<Texto>
					HOLA , <br />¿ <Span primary>Q</Span>UÉ
					<br />
					QUIERES <br />
					REGALAR <Span>?</Span>
				</Texto>
			</Container>
		</Fragment>
	);
};

export default Home;
